INSERT INTO `app_settings` VALUES ('1d789565-c250-4ccd-be44-72a95f5dbbb9','FAVOR-HELP','Un seul écosystème pour tous vos besoins.',NULL,'baenisam@gmail.com','0979649404',NULL,NULL,NULL,NULL,NULL,NULL,'sdsddsdssdds','USD','fr','{\"modules\":{\"ecommerce\":true,\"restaurant\":true,\"services\":true,\"cars\":true,\"rentals\":true,\"delivery\":true,\"tracking\":true,\"booking\":true},\"integrations\":{\"stripe\":true,\"paypal\":true,\"mobileMoney\":false,\"sms\":true,\"pushNotification\":true,\"manualPayment\":true},\"theme\":{\"mode\":\"light\",\"primaryColor\":\"#ff6600\",\"secondaryColor\":\"#ffffff\"},\"socialLinks\":{\"facebook\":\"\",\"instagram\":\"\"},\"feesAndExchange\":{\"exchangeRate\":\"1\",\"ecommerceDeliveryFee\":\"5\",\"marketDeliveryFee\":\"3\",\"restaurantBaseDeliveryFee\":\"3\",\"restaurantExtraFeePerItem\":\"1\"},\"system\":{\"maintenanceMode\":false,\"maintenanceMessage\":\"L’équipe Favor Help travaille sur quelques améliorations pour vous offrir une meilleure expérience. Revenez dans quelques instants, nous serons vite de retour\",\"allowUserRegistration\":true},\"advancedConfig\":{\"customParam1\":\"value1\",\"customParam2\":123,\"playStoreLink\":\"https://play.google.com/store/apps/details?id=com.favor_vendor\"}}','{}','{}',1.00,2.50,3.00,2.00,0.50,'<p><strong>Dernière mise à jour : 21 octobre 2025</strong></p><p>Bienvenue sur <strong>Favor Help</strong>. La présente politique de confidentialité décrit comment <strong>Favor Group</strong> collecte, utilise, partage et protège vos informations lorsque vous utilisez nos services. Cette politique s’applique à :</p><ol><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span>l’application principale <strong>Favor Help</strong> qui comporte plusieurs <strong>modules</strong> (ex. : boutique/e-commerce, food/restaurant, market, services, car rental, hotel booking, taxi booking, travel, logistics / shipping, etc.) ;</li><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span>l’application <strong>Favor Delivery</strong> (application distincte destinée aux livreurs / coursiers) ;</li><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span>l’application <strong>Favor Seller</strong> (application distincte destinée aux vendeurs / marchands) ;</li><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span>et tout autre service, site web ou API exploité par Favor Group (collectivement, les « Services »).</li></ol><p>En utilisant nos Services, vous acceptez les pratiques décrites dans cette politique. Si vous n’êtes pas d’accord, veuillez ne pas utiliser les Services.</p><p><strong>1. Données que nous collectons</strong></p><p>Nous collectons différentes catégories d’informations afin de fournir, améliorer et sécuriser nos Services.</p><p><strong>1.1 Données fournies directement par vous</strong></p><ol><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span><strong>Identité</strong> : nom, prénom, pseudonyme.</li><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span><strong>Coordonnées</strong> : adresse e-mail, numéro de téléphone, adresse postale.</li><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span><strong>Informations de compte</strong> : identifiants, mot de passe, photo de profil.</li><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span><strong>Données de paiement</strong> : informations de carte de paiement ou détails transmis à notre prestataire de paiement (nous ne stockons pas les numéros complets de carte sauf si vous utilisez un token fourni par un prestataire).</li><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span><strong>Documents vérificatifs</strong> : pièce d’identité, permis de conduire, documents KYC pour certains services (par ex. Favor Seller ou Favor Delivery).</li><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span><strong>Informations professionnelles</strong> : pour les vendeurs (Favor Seller) — nom de l’entreprise, SIRET/identifiant fiscal, adresse du magasin, coordonnées bancaires pour versements.</li><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span><strong>Contenu que vous fournissez</strong> : avis, messages, photos, descriptions de services, annonces.</li></ol><p><strong>1.2 Données collectées automatiquement</strong></p><ol><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span><strong>Localisation</strong> : données GPS et localisation approximative ou précise (pour livraison, géolocalisation du chauffeur, estimation des trajets).</li><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span><strong>Données d’appareil</strong> : modèle, OS et version, identifiants d’appareil, fournisseur d’accès, langue, fuseau horaire.</li><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span><strong>Données d’utilisation</strong> : logs, pages consultées, temps d’utilisation, interactions.</li><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span><strong>Données réseau</strong> : adresse IP, informations de connexion et session.</li><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span><strong>Cookies et technologies similaires</strong> : pour personnalisation, analyse et authentification.</li></ol><p><strong>1.3 Données reçues par des tiers</strong></p><ol><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span><strong>Connexion sociale</strong> : si vous vous connectez via Google, Facebook, Apple, nous recevons (selon autorisation) votre identifiant, e-mail et photo.</li><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span><strong>Partenaires</strong> : hôtels, restaurants, transporteurs, fournisseurs de paiement, prestataires de logistique et outils d’analyse.</li></ol><p><strong>2. Finalités du traitement</strong></p><p>Nous utilisons vos données pour :</p><ol><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span>créer, gérer et sécuriser votre compte ;</li><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span>exécuter les services demandés (livraisons, achats, réservations, location de véhicule, prestations de service, expéditions) ;</li><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span>traiter et suivre les paiements, remboursements et commissions ;</li><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span>fournir une assistance client ;</li><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span>envoyer des notifications liées aux commandes, livraisons et réservations ;</li><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span>personnaliser l’expérience (recommandations, promotions) ;</li><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span>analyser et améliorer nos produits, services, algorithmes et sécurité ;</li><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span>détecter et prévenir la fraude, les activités illicites ou les abus ;</li><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span>réaliser des obligations légales et comptables.</li></ol><p><strong>3. Base légale du traitement</strong></p><p>Selon l’activité et votre localisation, nous traitons les données sur la base de :</p><ol><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span><strong>L’exécution du contrat</strong> (fourniture des Services) ;</li><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span><strong>Votre consentement</strong> (marketing, cookies, notifications optionnelles) ;</li><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span><strong>Nos intérêts légitimes</strong> (sécurité, lutte contre la fraude, amélioration du service) ;</li><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span><strong>Obligations légales</strong> (comptabilité, fiscalité, demandes réglementaires).</li></ol><p><strong>4. Partage des données</strong></p><p>Nous partageons vos données uniquement lorsque nécessaire et avec des tiers de confiance :</p><ol><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span><strong>Prestataires opérationnels</strong> : prestataires de paiement, hébergement, envoi d’e-mails/SMS, services de cartographie et géolocalisation, partenaires logistiques, opérateurs télécom pour notifications.</li><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span><strong>Partenaires commerciaux</strong> : restaurants, hôtels, commerçants ou prestataires impliqués dans l’exécution d’une commande ou d’une réservation.</li><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span><strong>Fournisseurs analytiques et publicitaires</strong> : si vous consentez au marketing personnalisé.</li><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span><strong>Situation légale</strong> : si la loi ou une décision judiciaire l’exige.</li><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span><strong>Transferts d’entreprise</strong> : en cas de fusion, acquisition ou transfert d’actifs, vos données peuvent être transférées ; vous en serez informé.</li></ol><p>Nous ne <strong>vendons</strong> pas vos données personnelles.</p><p><strong>5. Données spécifiques par composant</strong></p><p><strong>Favor Delivery (livreurs)</strong></p><ol><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Collecte de localisation en temps réel pour accepter/optimiser les courses et calculer les trajets.</li><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Données KYC pour vérification : permis, identité, informations bancaires pour paiements.</li><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Données de performance : historique de courses, évaluations, revenus.</li></ol><p><strong>Favor Seller (vendeurs / marchands)</strong></p><ol><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Informations commerciales : catalogue, informations fiscales, coordonnées bancaires pour paiements et reversions.</li><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Données de commandes et ventes, statistiques, avis clients.</li></ol><p><strong>Modules (dans Favor Help)</strong></p><ol><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span>E-commerce / Boutique : catalogue, panier, historique de commandes.</li><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Food/Restaurant : commandes, menus, préférences alimentaires.</li><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Market, Services, Car rental, Hotel, Taxi, Travel, Logistics : données fonctionnelles propres à chaque service (ex. dates de réservation, détails du véhicule, adresse de livraison).</li></ol><p><strong>6. Conservation des données</strong></p><p>Nous conservons les données aussi longtemps que nécessaire pour :</p><ol><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span>exécuter les services et maintenir les comptes ;</li><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span>respecter nos obligations légales (durées de conservation fiscales, comptables) ;</li><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span>résoudre les litiges ;</li><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span>analyser et améliorer les services.</li></ol><p>Les données inutiles sont supprimées ou rendues anonymes.</p><p><strong>7. Sécurité</strong></p><p>Nous appliquons des mesures techniques et organisationnelles : chiffrement TLS, hachage des mots de passe, accès restreint, surveillance, sauvegardes, audits réguliers.</p><p>Cependant, aucune transmission sur Internet n’est totalement sécurisée ; nous recommandons d’utiliser des mots de passe robustes et d’activer les protections disponibles (ex. MFA).</p><p><strong>8. Vos droits</strong></p><p>Selon votre juridiction, vous pouvez exercer : accès, rectification, suppression, limitation, opposition, portabilité, et retrait du consentement. Pour exercer vos droits, contactez : <strong>privacy@favor-group.com</strong>.</p><p>Nous répondrons et traiterons les demandes conformément à la réglementation applicable.</p><p><strong>9. Données des mineurs</strong></p><p>Nos Services ne s’adressent pas aux personnes de moins de 16 ans. Nous ne collectons pas sciemment de données d’enfants. Si vous pensez qu’un mineur a fourni des données, contactez-nous et nous supprimerons ces données.</p><p><strong>10. Transferts internationaux</strong></p><p>Vos données peuvent être transférées vers des pays tiers. Nous mettons en place des garanties (clauses contractuelles types, accords de confidentialité) pour protéger les transferts.</p><p><strong>11. Cookies et technologies similaires</strong></p><p>Nous utilisons cookies, balises et identifiants d’appareil pour : authentification, préférences, analytics et personnalisation publicitaire (si vous consentez). Vous pouvez gérer vos préférences via les paramètres de l’appareil ou l’interface fournie.</p><p><strong>12. Conservation et suppression automatique</strong></p><ol><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Commandes &amp; transactions : conservées pour obligations fiscales et support (durée légale du pays).</li><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Comptes inactifs : après une période d’inactivité prolongée, un e-mail de notification sera envoyé avant suppression éventuelle.</li><li data-list=\"bullet\" class=\"ql-indent-1\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Logs et données analytiques : conservés sous forme agrégée puis supprimés selon la politique interne.</li></ol><p><strong>13. Liens et services tiers</strong></p><p>Nos Services peuvent contenir des liens vers des sites tiers. Nous ne sommes pas responsables de leurs pratiques. Consultez les politiques de ces tiers avant de partager vos données.</p><p><strong>14. Modifcations de la politique</strong></p><p>Nous pouvons modifier cette politique pour refléter des changements légaux, techniques ou commerciaux. Les mises à jour seront publiées avec la date de dernière mise à jour. Pour les changements significatifs, nous vous informerons par notification ou e-mail.</p><p><strong>15. Contact</strong></p><p>Pour toute question relative à la vie privée, aux demandes d’accès ou aux réclamations :</p><p><strong>Favor Group — Département Protection des Données</strong></p><p>Email : privacy@favorbusiness.com</p><p>Adresse : Goma, République Démocratique du Congo</p><p>Téléphone : +243 979 649 404</p><p><br></p><p>© 2025 <strong>Favor Group</strong> — Tous droits réservés.</p>','<h3>1. Présentation de la plateforme</h3><p>Favor Help est une application développée et exploitée par <strong>Favor Group</strong>, une société spécialisée dans les solutions numériques intégrées.</p><p>La plateforme Favor Help regroupe plusieurs modules et services, notamment :</p><ol><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span><strong>Favor Seller</strong> : application dédiée aux vendeurs pour la gestion de boutiques, produits et commandes.</li><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span><strong>Favor Delivery</strong> : application destinée aux livreurs pour la gestion des livraisons.</li><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span><strong>Modules intégrés</strong> : e-commerce, restauration (food delivery), supermarché (grocery), services, location de voitures, réservation d’hôtels, taxi, voyage et logistique (shipping).</li></ol><p>En accédant ou en utilisant les services de Favor Help, vous acceptez sans réserve les présentes conditions d’utilisation.</p><h3>2. Objet</h3><p>Les présentes Conditions Générales d’Utilisation ont pour objet de définir les modalités d’accès et d’utilisation de la plateforme Favor Help et de ses applications associées.</p><p>Elles constituent un contrat entre <strong>Favor Group</strong> et tout utilisateur des services proposés.</p><h3>3. Acceptation des conditions</h3><p>L’utilisation de Favor Help, Favor Seller ou Favor Delivery implique l’acceptation pleine et entière des présentes conditions.</p><p>Si vous n’acceptez pas ces conditions, vous ne devez pas utiliser les services proposés.</p><h3>4. Accès aux services</h3><p>L’accès aux services est ouvert à toute personne majeure disposant de la capacité juridique nécessaire.</p><p>Certaines fonctionnalités peuvent nécessiter la création d’un compte utilisateur et la validation d’une adresse e-mail ou d’un numéro de téléphone.</p><p>Favor Group se réserve le droit de suspendre ou de restreindre l’accès à un compte en cas d’utilisation abusive, frauduleuse ou contraire aux lois en vigueur.</p><h3>5. Création et gestion de compte</h3><p>Lors de l’inscription, l’utilisateur doit fournir des informations exactes, complètes et à jour.</p><p>L’utilisateur est responsable de la confidentialité de ses identifiants et de toutes les activités effectuées depuis son compte.</p><p>En cas de perte ou de vol de ses identifiants, l’utilisateur doit immédiatement en informer Favor Help.</p><h3>6. Utilisation des applications</h3><h4>a) <strong>Favor Help (Application principale)</strong></h4><p>Permet à l’utilisateur d’accéder à divers services selon sa localisation, tels que :</p><ol><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Commande et achat de produits,</li><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Réservation de services,</li><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Paiement sécurisé et suivi en temps réel,</li><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Gestion de son profil et de ses préférences.</li></ol><h4>b) <strong>Favor Seller</strong></h4><p>Application dédiée aux vendeurs et commerçants permettant de :</p><ol><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Gérer un catalogue de produits,</li><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Suivre les ventes et commandes,</li><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Gérer les paiements et livraisons,</li><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Accéder aux statistiques et outils marketing.</li></ol><h4>c) <strong>Favor Delivery</strong></h4><p>Application destinée aux livreurs indépendants ou affiliés :</p><ol><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Réception et livraison des commandes,</li><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Suivi en temps réel des trajets,</li><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Historique des courses et paiements,</li><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Système de notation et de performance.</li></ol><h3>7. Obligations des utilisateurs</h3><p>L’utilisateur s’engage à :</p><ol><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Utiliser la plateforme de manière loyale et conforme à la loi ;</li><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Ne pas diffuser de contenu illégal, diffamatoire, ou offensant ;</li><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Ne pas interférer avec le bon fonctionnement de la plateforme ;</li><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Respecter les droits des autres utilisateurs, partenaires et livreurs.</li></ol><h3>8. Responsabilités de Favor Group</h3><p>Favor Group met tout en œuvre pour assurer la disponibilité, la sécurité et la fiabilité de la plateforme.</p><p>Cependant, Favor Group ne saurait être tenu responsable :</p><ol><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>En cas d’interruption de service pour maintenance, mise à jour ou problème technique ;</li><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Des pertes financières, dommages indirects ou consécutifs à l’utilisation de la plateforme ;</li><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Du comportement des vendeurs, clients ou livreurs tiers utilisant le service.</li></ol><h3>9. Paiements et facturation</h3><p>Les paiements effectués sur Favor Help sont sécurisés et traités par des partenaires agréés.</p><p>Les prix affichés incluent les taxes applicables.</p><p>Favor Group se réserve le droit de percevoir une commission sur chaque transaction conformément à sa politique tarifaire.</p><h3>10. Données personnelles et confidentialité</h3><p>La collecte et le traitement des données sont réalisés conformément à la <strong>Politique de Confidentialité</strong> de Favor Help.</p><p>Les données sont utilisées pour améliorer les services, assurer la sécurité des transactions et offrir une expérience personnalisée.</p><h3>11. Propriété intellectuelle</h3><p>Tous les éléments présents sur Favor Help (logos, textes, images, interface, code source, etc.) sont la propriété exclusive de Favor Group.</p><p>Toute reproduction, distribution ou modification non autorisée est strictement interdite.</p><h3>12. Résiliation</h3><p>Favor Group se réserve le droit de suspendre ou de supprimer un compte utilisateur en cas de violation des présentes conditions ou de comportement frauduleux.</p><p>L’utilisateur peut à tout moment supprimer son compte depuis son espace personnel.</p><h3>13. Modifications des conditions</h3><p>Favor Group peut à tout moment modifier les présentes conditions d’utilisation.</p><p>Toute modification prendra effet dès sa publication sur la plateforme.</p><p>L’utilisateur est invité à consulter régulièrement cette section.</p><h3>14. Contact</h3><p>Pour toute question ou réclamation concernant l’utilisation de Favor Help, Favor Seller ou Favor Delivery :</p><p><strong>support@favorbusiness.com</strong></p><p><strong>www.favorbusiness.com</strong></p>','2025-10-24 08:05:44.776780','2025-10-31 10:02:33.000000','{}');
