 that it would not change its business plans for the year despite all the challenges in the market. Mercedes-Benz India MD & CEO Martin Schwenk said their plans of launching 10 products in India in 2020 remained on track and they would proceed as planned. There will be some delays but the company was working to minimise the impact, he said. Schwenk said the company had received 100 online bookings for its new and used cars. The company had launched sales on its e-commerce platform on April 27 that enabled customers to order their Mercedes vehicles from home.',NULL,'CAR',NULL,6,'https://res.cloudinary.com/dp4ghafpd/image/upload/v1754723980/favor/product/1754723979661-31be5d9d-19e6-4d46-8979-3ffad837313e.webp','2025-08-09 07:19:40.539968','2025-08-12 07:24:19.000000','8776e25d-82ce-428f-ab77-2447880804b8','945a376c-7707-4b94-acfa-330995d55a8c',NULL,NULL,NULL,NULL,'PUBLISHED',NULL,'RETAILER',NULL,'Benz','2020','RENTAL',120.00,0.00,'ESSENCE','AUTOMATIC','Gray',140.00,0,0,NULL,NULL,0,0,0,NULL),('15f57b9d-bb29-463c-9a51-63358fc451ce','Légumes ','Légumes frais ',NULL,'GROCERY',NULL,100,'https://res.cloudinary.com/dp4ghafpd/image/upload/v1762221560/favor/product/1762221560474-b7274fa6-4dce-4d21-b2e7-f46d83e09c4d.webp','2025-11-04 01:59:21.233110','2025-11-04 01:59:21.233110','494e78c6-5a21-4f6d-973a-de493e314d29','0a529dc5-306d-4737-b4e3-e201bb9b26a2',1.00,NULL,1.00,NULL,'PENDING','2237be71-7ced-4101-907e-89fb1b1b4fa3','RETAILER',NULL,NULL,NULL,'RENTAL',NULL,NULL,'DIESEL','MANUAL',NULL,NULL,1,0,NULL,NULL,0,0,0,NULL),('167edd83-cfca-473d-b1e7-d9dc73264c5f','viande japonais ','Découvrez l\'authenticité et l\'excellence culinaire avec notre viande japonaise, une expérience gastronomique inégalée qui saura séduire les palais les plus exigeants. Provenant des terres fertiles du Japon, notre sélection de viandes premium est soigneusement choisie pour sa qualité exceptionnelle et son goût inimitable.\r\n\r\nChaque morceau de viande est le fruit d\'un savoir-faire ancestral, garanti par des élevages responsables qui respectent le bien-être animal. Que vous soyez amateur de bœuf Wagyu au marbrage exquis, de porc Kurobuta aux saveurs délicates ou de volailles élevées en plein air, chaque bouchée vous transportera au cœur de la tradition culinaire japonaise.\r\n\r\nNotre viande est préparée selon des méthodes traditionnelles, et notre équipe de chefs talentueux veille à ce que chaque plat mette en valeur les textures et les arômes uniques de cette gastronomie raffinée. Que vous souhaitiez savourer un steak grillé, une fondue savoureuse ou des sushis créatifs, nos recettes mettent en avant la richesse des produits japonais.\r\n\r\nEn choisissant notre viande japonaise, vous optez pour une qualité supérieure, une traçabilité impeccable et une explosion de saveurs dans votre assiette. Rejoignez-nous pour découvrir une nouvelle dimension de la gastronomie, où chaque repas devient une célébration des sens. Réservez dès maintenant et laissez-vous séduire par la quintessence de la cuisine japonaise dans notre restaurant.',NULL,'RESTAURANT',NULL,10,'https://res.cloudinary.com/dp4ghafpd/image/upload/v1762258250/favor/product/1762258249950-de0051ba-2222-4ad8-a503-c4a3b50a5686.webp','2025-11-04 12:10:51.029502','2025-11-04 12:10:51.029502','d1b1dc2f-8bf0-4c6e-a482-a5c3866fddb3','8028072e-2d7a-4ba8-a026-70d58ced7390',7.00,NULL,6.00,NULL,'PUBLISHED','3ac1ed2a-0a27-4c00-8e76-fc6d1c35e907','RETAILER',NULL,NULL,NULL,'SALE',NULL,NULL,'ESSENCE','AUTOMATIC',NULL,NULL,1,0,NULL,NULL,0,0,0,NULL),('1a157d29-9cb4-4e08-93d1-a38b7cfcd23d','Tablette','Hp',NULL,'SHOP',NULL,12,'https://res.cloudinary.com/dp4ghafpd/image/upload/v1761145515/favor/product/1761145514792-c7238acc-f797-408b-839d-7d85f7526f2b.webp','2025-10-22 15:05:16.197715','2025-10-25 14:18:01.000000','24114621-cc6a-4430-8711-fb768d5c8a90','3f4be3f8-964d-47bd-b71b-2cc99e2319bb',220.00,NULL,150.00,NULL,'PUBLISHED','9d86b792-8f7e-4b7d-913e-a9779c14cdfe','RETAILER',NULL,NULL,NULL,'RENTAL',NULL,NULL,'DIESEL','MANU