oit idéal pour savourer des douceurs qui ravissent tous les âges.\r\n\r\nN\'attendez plus pour vous offrir une parenthèse gourmande au cœur de notre restaurant. Commandez dès maintenant et laissez nos créations transformer vos repas en souvenirs inoubliables. Éclat Sucré, l\'écrin de vos envies sucrées.',NULL,'RESTAURANT',NULL,100,'https://res.cloudinary.com/dp4ghafpd/image/upload/v1761996452/favor/product/1761996451485-0cc658c9-f1e6-4830-a025-addcca4e12fe.webp','2025-11-01 11:27:32.448541','2025-11-01 11:27:32.448541','d1b1dc2f-8bf0-4c6e-a482-a5c3866fddb3','a31bda05-a6f3-4fcb-beb3-2bb8f967cd1a',12.00,NULL,10.00,NULL,'PUBLISHED','5d29e72f-c955-44bd-b388-5d463e42c9e8','RETAILER',NULL,NULL,NULL,'SALE',NULL,NULL,'ESSENCE','AUTOMATIC',NULL,NULL,1,0,NULL,NULL,0,0,0,NULL),('64be2bf9-c123-432b-b317-eb03fc4d766a','Coco donga','Bonne qualité ',NULL,'SHOP',NULL,5,'https://res.cloudinary.com/dp4ghafpd/image/upload/v1762163008/favor/product/1762163007525-68ea3aa1-5d19-4db7-bb1f-be66dfeb7abd.webp','2025-11-03 09:43:28.606610','2025-11-03 09:43:28.606610','988886c0-31bc-4ac7-a63a-87b9d5c87b2a','542de0d4-fa81-4182-bef7-07dde59845be',22.00,22.00,20.00,20.00,'PENDING','b50972ec-52a6-4510-8910-d96cfe7970ad','WHOLESALER_RETAILER',NULL,NULL,NULL,'RENTAL',NULL,NULL,'DIESEL','MANUAL',NULL,NULL,1,0,NULL,NULL,0,0,0,NULL),('6673883a-0979-44bd-b774-43aa1e83690c','Spaghettis aux courgettes',NULL,NULL,'RESTAURANT',NULL,30,'https://res.cloudinary.com/dp4ghafpd/image/upload/v1761300613/favor/product/1761300612982-639d7806-28cf-4286-8beb-061c557f349c.webp','2025-10-24 10:10:14.006590','2025-10-25 14:10:34.000000','d1b1dc2f-8bf0-4c6e-a482-a5c3866fddb3','92308c26-6dd4-42e4-8b41-a8afb6ecda32',6.00,NULL,6.00,NULL,'PUBLISHED','3ac1ed2a-0a27-4c00-8e76-fc6d1c35e907','RETAILER',NULL,NULL,NULL,'RENTAL',NULL,NULL,'DIESEL','MANUAL',NULL,NULL,1,0,NULL,NULL,0,0,0,NULL),('68032c0a-3989-403a-8d7e-b4e417023eea','Pizza','Pizza Margherita ',NULL,'RESTAURANT',NULL,100,'https://res.cloudinary.com/dp4ghafpd/image/upl