ec Hallux et transformez votre routine automobile en un moment de plaisir et de simplicité.\r\n\r\nRejoignez la communauté des utilisateurs de Hallux et redécouvrez le plaisir de conduire. Commandez dès maintenant et profitez d\'une promotion exclusive pour une période limitée. Avec Hallux, une conduite sans compromis vous attend.',NULL,'CAR',NULL,20,'https://res.cloudinary.com/dp4ghafpd/image/upload/v1762258019/favor/product/1762258018628-6f3ff2d8-efd0-4bfd-b754-cbbfaaabc541.webp','2025-11-04 12:06:59.698528','2025-11-04 12:06:59.698528','ad5baf05-6a76-41d9-b19c-eca58869ccf6','05502325-409b-437a-a173-67e2e3125184',15000.00,NULL,10000.00,NULL,'PUBLISHED','0f1369a0-e0ad-4f51-a881-f1af7a5c898a','RETAILER',NULL,NULL,NULL,'SALE',NULL,NULL,'ESSENCE','AUTOMATIC',NULL,NULL,1,0,'9f92db74-9ee1-4bd3-aaa1-53607ff7031f',NULL,0,0,0,NULL),('f26f6227-3aa0-48f5-9eab-6d77ae170f49','Rotis','La bonne saveur',NULL,'RESTAURANT',NULL,1,'https://res.cloudinary.com/dp4ghafpd/image/upload/v1761401371/favor/product/1761401365039-2aaf311e-b8e4-4a14-be5a-708226c455cb.webp','2025-10-25 14:09:39.389034','2025-10-25 14:11:41.000000','0f03f6ae-d6eb-4df4-8286-f15f6b59c67f','9ce72eb4-c361-4e85-994c-b28e487f8f12',15.00,NULL,15.00,NULL,'PUBLISHED','3dcaa419-1568-4555-932b-89be744fc1b8','RETAILER',NULL,NULL,NULL,'RENTAL',NULL,NULL,'DIESEL','MANUAL',NULL,NULL,1,0,NULL,NULL,0,0,0,NULL),('f73fb2b9-6699-4bb1-8f8a-b8972a6b448b','Croissants','Pain d\'Épi, a French baguette shaped like a wheat stalk, is a traditional and visually striking bread known for its crisp crust and airy crumb.\n It is made using a simple dough similar to a standard baguette but features distinctive scoring with scissors to create its unique form.\n\nPrep Time: 15 minutes',NULL,'GROCERY',NULL,1,'https://res.cloudinary.com/dp4ghafpd/image/upload/v1759485914/favor/product/1759485914095-cfc513cd-0566-4728-b05f-386564c36b4a.webp','2025-10-03 10:05:15.086682','2025-10-03 10:08:50.000000','d4a739d5-e37b-4e0b-9274-a3bbdc24503b','7987b07f-818